// File: src/pages/Submit.jsx
import React, { useState, useEffect } from "react";
import { Helmet } from "react-helmet";
import axios from "axios";

import NavBar from "../components/common/navBar";
import Footer from "../components/common/footer";
import Logo from "../components/common/logo";
import INFO from "../data/user";
import SEO from "../data/seo";

import "./styles/SubmitForm.css";

const Submit = () => {
	const [formData, setFormData] = useState({
		name: "",
		email: "",
		message: "",
	});
	const [success, setSuccess] = useState(false);
	const [isLoading, setIsLoading] = useState(false);
	const [error, setError] = useState("");

	useEffect(() => {
		window.scrollTo(0, 0);
	}, []);

	const currentSEO = SEO.find((item) => item.page === "submit");

	const handleChange = (e) => {
		setFormData({ ...formData, [e.target.name]: e.target.value });
		// Clear success and error messages when user starts typing
		if (success) setSuccess(false);
		if (error) setError("");
	};

	const handleSubmit = async (e) => {
		e.preventDefault();
		setIsLoading(true);
		setError("");
		setSuccess(false);

		try {
			const API_URL =
				process.env.REACT_APP_API_URL || "http://localhost:5000";
			await axios.post(`${API_URL}/api/customers`, formData);
			setSuccess(true);
			setFormData({ name: "", email: "", message: "" });
		} catch (err) {
			setError("Gagal mengirim pesan. Silakan coba lagi.");
			console.error("Gagal mengirim pesan:", err);
		} finally {
			setIsLoading(false);
		}
	};

	return (
		<>
			<Helmet>
				<title>{`Submit | ${INFO.main.title}`}</title>
				<meta
					name="description"
					content={currentSEO?.description || ""}
				/>
				<meta
					name="keywords"
					content={currentSEO?.keywords?.join(", ") || ""}
				/>
			</Helmet>

			<div className="page-content">
				<NavBar active="submit" />
				<div className="content-wrapper">
					<div className="login-logo-container">
						<div className="login-logo">
							<Logo width={46} />
						</div>
					</div>

					<div className="login-container">
						<div className="login-main">
							<div className="login-form-wrapper">
								<h2 className="login-title">
									Diskusikan Proyek Anda
								</h2>
								<form
									onSubmit={handleSubmit}
									className="login-form"
								>
									<input
										type="text"
										name="name"
										placeholder="Nama"
										value={formData.name}
										onChange={handleChange}
										required
										disabled={isLoading}
									/>
									<input
										type="email"
										name="email"
										placeholder="Email"
										value={formData.email}
										onChange={handleChange}
										required
										disabled={isLoading}
									/>
									<textarea
										name="message"
										placeholder="Pesan"
										value={formData.message}
										onChange={handleChange}
										required
										disabled={isLoading}
										style={{ minHeight: "100px" }}
									/>
									<button type="submit" disabled={isLoading}>
										{isLoading ? "Mengirim..." : "Kirim"}
									</button>
								</form>

								{success && (
									<p
										style={{
											color: "green",
											marginTop: "10px",
										}}
									>
										Pesan berhasil dikirim!
									</p>
								)}

								{error && (
									<p
										style={{
											color: "red",
											marginTop: "10px",
										}}
									>
										{error}
									</p>
								)}
							</div>
						</div>
					</div>

					<div className="page-footer">
						<Footer />
					</div>
				</div>
			</div>
		</>
	);
};

export default Submit;
